from math import sqrt

def calculate_disk_positions(n, r, x_coords):
    d = r / 2.0
    d2 = d * d
    positions = []
    for x in x_coords:
        (le, ri, h) = (x - d, x + d, r)
        for (u, v) in positions:
            if le <= u <= ri:
                w = x - u
                y = v + sqrt(d2 - w * w)
                if h < y:
                    h = y
        positions.append((x, h))
    return [y for (x, y) in positions]

